import React from 'react';
import * as PropTypes from 'prop-types';
import {withStyles} from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import GridList from '@material-ui/core/GridList';

const styles = theme => ({
    root: {
      flexGrow: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },
    grow: {
      flexGrow: 1,
    },
    grid:{
      width: "100%",
      height: "50%",
    },
    canvas: {
      position: 'absolute',
      top: 0,
      left: 0,
      bottom: 0,
      right: 0,
    }
});

function home(props){
  const {classes} = props;

  return (
    <div className={classes.root}>
    <img
  src={"https://image.dhgate.com/0x0s/f2-albu-g5-M01-53-D7-rBVaJFi6NDCAL_1pAAOIbm7LX1M667.jpg/luxury-european-modern-beautiful-scenery.jpg"}
  style={styles.canvas} />
    </div>
  );
}

home.propTypes = {
    classes: PropTypes.object.isRequired,
};
export default withStyles(styles)(home);
